&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="2"&gt;The number of days in the mean tropical year B1900 (days).
This value is taken from the SOFA (Standards of Fundamental Astronomy) library, which is
assumed to be authoritative.&lt;/p&gt;

&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="2"&gt;The Gregorian Calendars repeats on a 400-year cycle called the solar cycle.
There are 97 leap years in that period, giving an average calendar year length of
365 + (97/400) = 365.2425 days/year&lt;/p&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="6"&gt;1 Gregorian solar cycle = 400 y = 4800 mon = 20,871 w = 146,097 d
5 Gregorian solar cycles = 2 ky&lt;/p&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="9"&gt;Solar cycles are not ordinarily numbered, nor are they given a specific start date.
However, within the proleptic Gregorian epoch (the one used by .NET), which began on 1 Jan,
1 AD, we are currently in the 6th solar cycle. It began on Monday, 1 Jan, 2001 (also the
first day of the 3rd millennium A.D), and will end on Sunday, 31 Dec, 2400.
This aligns nicely with the ISO standard of beginning weeks on a Monday.&lt;/p&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="15"&gt;See: &lt;a href="https://en.wikipedia.org/wiki/Solar_cycle_(calendar)"&gt;https://en.wikipedia.org/wiki/Solar_cycle_(calendar)&lt;/a&gt;
See: &lt;a href="https://en.wikipedia.org/wiki/Proleptic_Gregorian_calendar"&gt;https://en.wikipedia.org/wiki/Proleptic_Gregorian_calendar&lt;/a&gt;&lt;/p&gt;

