&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="2"&gt;Additional members to supplement the TimeSpan class.&lt;/p&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="4"&gt;Mostly constants.
As in TimeSpan, I've used long as the type for any integer constants.
I've used double for non-integer constants.&lt;/p&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="8"&gt;The following are already provided by the TimeSpan class and not reproduced here:&lt;/p&gt;
&lt;ul sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="9"&gt;
&lt;li sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="9"&gt;TicksPerMicrosecond&lt;/li&gt;
&lt;li sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="10"&gt;TicksPerMillisecond&lt;/li&gt;
&lt;li sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="11"&gt;TicksPerSecond&lt;/li&gt;
&lt;li sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="12"&gt;TicksPerMinute&lt;/li&gt;
&lt;li sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="13"&gt;TicksPerHour&lt;/li&gt;
&lt;li sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="14"&gt;TicksPerDay&lt;/li&gt;
&lt;/ul&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="16"&gt;&lt;strong&gt;NOTE: Any constants or methods for converting between time units will become obsolete
with the completion of Galaxon.Quantities. So, don't use these for anything permanent.&lt;/strong&gt;&lt;/p&gt;
&lt;p sourcefile="api/Galaxon.Core.Time.XTimeSpan.yml" sourcestartlinenumber="19"&gt;The word Month, Year, Decade, Century, or Millennium in a constant name usually refers to the
average length of that time unit in the Gregorian.&lt;/p&gt;
